def _cython_agg_blocks(
    self, how: str, alt=None, numeric_only: bool = True, min_count: int = -1
) -> "Tuple[List[Block], Index]":
    data: BlockManager = self._get_data_to_aggregate()

    if numeric_only:
        data = data.get_numeric_data(copy=False)

    agg_blocks: List[Block] = []
    new_items: List[np.ndarray] = []

    for block in data.blocks:
        locs = np.array(block.mgr_locs)

        try:
            result, _ = self.grouper.aggregate(
                block.values, how, axis=1, min_count=min_count
            )
        except Exception as e:
            if alt is not None:
                obj = self.obj[data.items[locs]]
                result = obj.aggregate(lambda x: alt(x, axis=self.axis))
            else:
                raise e

        # Handling ExtensionBlock
        if block.is_extension and isinstance(result, np.ndarray):
            if isinstance(block, ExtensionBlock):
                result = type(block.values)._from_sequence(
                    result.ravel(), dtype=block.values.dtype
                )

        agg_block: Block = make_block(result, placement=block.mgr_locs, ndim=2)

        new_items.append(locs)
        agg_blocks.append(agg_block)

    if not agg_blocks:
        raise DataError("No numeric types to aggregate")

    # Adjust the indexer to account for the removed items
    indexer = pd.array(np.concatenate(new_items))
    agg_items = np.array(data.items.take(indexer))

    return agg_blocks, agg_items
